import Loader from "react-loader-spinner";
import { FaRegHospital } from "react-icons/fa";
const Testresults = ({ data }) => {
  return (
    <div className="prescription w-full h-full mt-5 p-6">
      <div className="flex flex-row">
        {data ? (
          data.map((item, index) => {
            return (
              <div className="prescription__card mt-8" key={index}>
                <div className="testresult__card m-3 p-4 bg-white">
                  <div className="testresult__card__top flex flex-row items-center">
                    <div className="icn text-6xl p-2 ml-4 w-32 h-32 rounded-full flex items-center justify-center bg-yellow-300 bg-opacity-60">
                      ðŸ’‰
                    </div>
                    <div className="flex flex-col ml-4">
                      <p className="text-3xl sub-txt head-txt font-bold tracking-tight">
                        Blood Pressure
                      </p>
                      <div className="flex flex-row items-center">
                        <FaRegHospital size="2em" color="#8390bb" />
                        <p className="text-3xl sub-txt head-txt font-medium tracking-tight">
                          Blood Pressure
                        </p>
                      </div>
                    </div>
                  </div>
                </div>
              </div>
            );
          })
        ) : (
          <div className="flex  w-full h-full justify-center items-center">
            <Loader type="TailSpin" color="#575ce5" height={65} width={65} />
          </div>
        )}
      </div>
    </div>
  );
};

export default Testresults;
